def epsilon_okruzenje(stanja):
    Y = []
    if type(stanja) is list:
        stog = [] + stanja
    else:
        stog = [stanja]
    while stog:
        stanje_t = stog.pop()
        if not tablica_prijelaza.get((stanje_t, '$')):
            return Y
        for stanje_v in tablica_prijelaza.get((stanje_t, '$')):
            if (stanje_t, '$') in tablica_prijelaza:
                if stanje_v not in Y:
                    Y.append(stanje_v)
                    stog.append(stanje_v)
    return Y


def citaj(kazaljka):
    if kazaljka >= len(izvorni_kod):
        return
    return izvorni_kod[kazaljka]

def prijelaz_iz_vise_stanja(Q, znak):
    lista_prijelaza = set()
    for stanje in Q:
        if tablica_prijelaza.get((stanje, znak)):
            lista_prijelaza.update(tablica_prijelaza.get((stanje, znak)))
    return list(lista_prijelaza)


def simuliraj():
    global tablica_prijelaza
    global izvorni_kod
    global prihvatljiva_stanja
    R = epsilon_okruzenje([-1])
    pocetak = 1
    zavrsetak = 0
    posljednji = 1
    izraz = 0
    a = ''
    while zavrsetak < len(izvorni_kod):
        while R:
            P = set(R).intersection(set(prihvatljiva_stanja))
            P = list(P)
            if not P and R:
                a = citaj(zavrsetak)
                if a == None:
                    break
                print("ucitan znak:", a)
                zavrsetak += 1
                Q = R
                R = epsilon_okruzenje(prijelaz_iz_vise_stanja(Q, a))
            elif P:
                izraz = -1
                for trenutno_pocetno_stanje in tablica_prijelaza.get((-1, '$')):
                    gotovo = False
                    for stanje_P in P:
                        if stanje_P >= trenutno_pocetno_stanje:
                            izraz += 1
                        else:
                            gotovo = True
                            break
                    if gotovo:
                        break
                print("IZRAZ:", izraz)
                posljednji = zavrsetak
                zavrsetak += 1
                Q = R
                a = citaj(zavrsetak)
                if a == None:
                    break
                print("ucitan znak:", a)
                R = epsilon_okruzenje(prijelaz_iz_vise_stanja(Q, a))
        if izraz == 0:
            print("ne valja znak " + str(a) + " na poziciji: " + str(pocetak))
            zavrsetak = pocetak
            pocetak += 1
            R = epsilon_okruzenje([-1])
        else:
            print("niz znakova " + izvorni_kod[pocetak: posljednji+1] + " spada pod indeks " + str(izraz))
            #ubacit dio za svrstavanje u klasu leks.jedinke na temelju varijable izraz
            izraz = 0
            pocetak = posljednji + 1
            zavrsetak = posljednji
            R = epsilon_okruzenje([-1])
    return


